import React from 'react';
import { NavLink } from 'react-router-dom';
import './Header.css'; // Import the CSS file

const Header = () => {
  return (
    <header className="header">
      {/* Logo Section */}
      <div className="logo-container">
        <img src="path/to/your/logo.jpg" alt="Logo PaDi UMKM" className="logo" />
        <div className="logo-text">
          <p className="logo-title">PaDi UMKM</p>
          <p className="logo-subtitle">Pasar Digital UMKM Indonesia</p>
        </div>
      </div>

      {/* Navigation Links */}
      <nav className="nav">
        <NavLink exact to="/" className="nav-link" activeClassName="active">Beranda</NavLink>
        <NavLink to="/about" className="nav-link" activeClassName="active">Tentang Kami</NavLink>
        <NavLink to="/help" className="nav-link" activeClassName="active">Bantuan</NavLink>
        <NavLink to="/media" className="nav-link" activeClassName="active">Media</NavLink>
        <NavLink to="/contact" className="nav-link" activeClassName="active">Kontak</NavLink>
      </nav>

      {/* Login Button */}
      <div className="login-container">
        <NavLink to="/login" className="login-button">Login</NavLink>
      </div>
    </header>
  );
}

export default Header;
